import React, { useState, useEffect } from "react";
import LakeCards from './'
const Home = () => {
    const [lakes, setLakes] = useState([]);
    useEffect(() => {
        fetch("https://jasonserverhoustonfishing.herokuapp.com/lakes")
            .then(res => res.json())
            .then(rsp => {
                setLakes(rsp)
                
            },[lakes]);
    });
    return (
        <div>
            {lakes.map((lake)=>{
                console.log(lake)
                return <LakeCards key={lake._id} lake={lake.name}/>
            })}

        </div>
    );
};
export default Home;
